import React from 'react';
import '../App.css';

function AboutUs() {
  return (
    <div className="container" style={{ padding: '20px' }}>
      <h1>About Us</h1>
      <section className="section">
        <h2>Company Introduction</h2>
        <p>
          Shundao is a leading supplier of innovative, sustainable yarns with production in Vietnam and global influence.
          Our advanced technology and commitment to quality drive our success.
        </p>
      </section>
      <section className="section">
        <h2>Core Concept & Timeline</h2>
        <p>
          Our mission is to break through limitations. Over the years, we have evolved through continuous innovation and strategic partnerships.
        </p>
        {/* 此处可以增加交互式 Timeline 组件 */}
      </section>
      <section className="section">
        <h2>Production & Market</h2>
        <p>
          With state-of-the-art production facilities and extensive market reach, our products are trusted worldwide.
        </p>
      </section>
    </div>
  );
}

export default AboutUs;
